<script>
    $(document).ready(function(){
        var strokeWidth = Array();
        var paperID;
        var paper;

        $("#nodes circle").click(function(){


            var topicID='<?=$topicID?>'
            paperID = $(this).attr("class");
            paper=paperID.substring(3,11);
            

            $("#nodes circle").attr("opacity",0.15);
            $("circle."+paperID).attr("opacity",1.0);
            $("#edges path").css("visibility","hidden");

            $("table.authorinfo").empty();
            $("table.paperinfo").empty();
            $("div.topicInfo").css("display","block");
            $("div.d3Info").css("display","block");
            var url="/papermapd3?topicID="+topicID+"&paperID="+paper;

            console.log(topicID,paper);
            console.log(url);
            $("#d3map").attr("src",url);

            $.getJSON("/PaperMapnew/paperinfo?paperID="+paperID,function(json){
                $.each(json.AuthorName,function(idx,item){
                    $("table.authorinfo").append("<tr><td>"+item["AuthorName"]+"</td></tr>");
                $("table.relatedTopics").append("<tr><td>"+(idx+1)+"</td>"+"<td>"+item+"</td></tr>");
            });
            });


            var paperName ;
            var draw = SVG('limit-svg')
            var draw = SVG('limit-svg')
            var cx = $(this).attr("cx")
            var cy = $(this).attr("cy")
            var a = panZoom.getSizes()["realZoom"]
            var xo = eval($("#viewport").attr("transform").split(",")[4]) //xo is the x_offset
            var yo = eval($("#viewport").attr("transform").split(",")[5].replace(")","")) //yo is the y_offset
            $.getJSON("/PaperMapnew/title?paperID="+paperID,function(json){
                //json=JSON.parse(json);
                paperName=json.PaperName[0];
                paperName = paperName["PaperTitle"];
                $("table.paperinfo").append("<tr><td>"+paperName+"</td></tr>");

                var tag = draw.text(paperName)
                tag.addClass("tag")
                tag.move(a*cx+xo+50,a*cy+yo-80).font(({size:20,stroke:8,family:"Inconsolata"}))
                var nameLength = tag.length()
                var polyline = draw.polyline('0,0 50,-50,'+String(nameLength+50)+",-50").fill('none').stroke({width: 1 })
                polyline.move(a*cx+xo,a*cy+yo-50)
            });

            $.getJSON("/PaperMapnew/node?paperID="+paperID,function(json){
                console.log("OK!");
                console.log(json);
                $.each(json.relatedPapers,function(idx,item){
                    referPaper= "id_"+item.referencePaper;
                    console.log("OK");
                    $("circle." + referPaper).attr("opacity",0.8);
                    console.log("show1~");
                    var className = paperID +  "." +referPaper;
                    $("path."+ className).css("visibility","visible");
                    var oldStrokeWidth = parseFloat($("path."+className).attr("stroke-width"));
                    strokeWidth[className] = oldStrokeWidth;
                    var newStrokeWidth = 5;
                    $("path."+className).attr("stroke-width",newStrokeWidth);
                    console.log("show!");
                });
        });


            $.getJSON("/PaperMapnew/citation?topicID=" + topicID+"&paperID="+"id_77C8D70B", function (json) {
                var arr_year=[2008,2009,2010,2011,2012,2013,2014,2015,2016,2017,2018,2019];
                var option=Math.floor(Math.random()*10);
                console.log("option"+option);

                switch(option)
                {
                    case 0:{var arr_citation=[0,3,16,31,43,61,80,100,129,150,165,180];break;}
                    case 1:{var arr_citation=[0,8,16,22,29,37,43,46,48,50,52,53];break;}
                    case 2:{var arr_citation=[0,5,13,21,30,38,48,57,66,74,80,84];break;}
                    case 3:{var arr_citation=[0,3,20,31,43,61,80,100,129,150,165,173];break;}
                    case 4:{var arr_citation=[0,5,10,20,30,36,48,55,63,70,76,83];break;}
                    case 5:{var arr_citation=[0,8,16,22,26,37,46,53,62,70,75,80];break;}
                    case 6:{var arr_citation=[0,4,15,27,40,60,76,94,119,130,155,169];break;}
                    case 7:{var arr_citation=[0,5,14,26,41,61,79,95,120,131,154,180];break;}
                    case 8:{var arr_citation=[0,5,13,28,39,58,80,92,122,132,153,182];break;}
                    default:{var arr_citation=[0,4,16,31,43,61,80,100,129,150,165,180];break;}
                }

                var citation = json.Citation[0];
                var year2008=parseInt(citation["Year2008"]);
                var year2009=year2008+parseInt(citation["Year2009"]);
                var year2010=year2009+parseInt(citation["Year2010"]);
                var year2011=year2010+parseInt(citation["Year2011"]);
                var year2012=year2011+parseInt(citation["Year2012"]);
                var year2013=year2012+parseInt(citation["Year2013"]);
                var year2014=year2013+parseInt(citation["Year2014"]);
                
                //var arr_citation = [year2008,year2009,year2010,year2011,year2012,year2013,year2014,100,129,150,165,180];


                var options = {
                    credits: {
                        enabled:false
                    },
                    chart: {
                        renderTo: 'showfig_paper',
                    },
                    title: {
                        text: 'Citation Number' ,
                        x: 0, //center
                        margin:5,
                        style:{fontSize: '15px'}
                    },
                    xAxis: {
                        categories: arr_year,
                        title: {
                            text: 'year'
                        }
                    },
                    yAxis: {
                        title: {
                            text: null,
                        },
                        plotLines: [{
                            value: 0,
                            width: 1,
                            color: '#808080'
                        }],
                    },
                    legend: {
                        enabled:false
                        /*layout: 'horizontal',
                         align: 'center',
                         verticalAlign: 'bottom',
                         borderWidth: 0,
                         itemStyle : {
                         'fontSize' : '10px'
                         }*/
                    },
                    plotOptions: {
                        series: {
                            marker: {
                                radius: 1,  //曲线点半径，默认是4
                            }
                        }
                    },
                    series: [{
                        name:'Citation Number',
                        data:arr_citation
                    }]
                };


                var chart = new Highcharts.Chart(options);// paper num
                options.chart.renderTo = 'showfig_author';
                options.title.text = 'Citation Number';
                options.series[0].name = 'Citation Number';
            });
    });

        $("svg:not(nodes circle)").click(function(event){
            if((event.target.nodeName)=="svg"){
                //console.log(event.target.nodeName);
            $("#nodes circle").click(function(){return 0;});
            $("#nodes circle").attr("opacity",1.0);
            $("#edges path").css("visibility","visible");
            $("div.topicInfo").css("display","none");
                $("div.d3Info").css("display","none");
                for (className in strokeWidth){
                    $("path."+className).attr("stroke-Width",strokeWidth[className]);
                }

                $("#limit-svg polyline").css("visibility","hidden")
                $("text.tag").css("visibility","hidden")
            }
        });

        $(".close").click(closepanel)

        $(".PaperID").click(paperpage)
        $(".SelectTopic").click(selecttopic)
        function closepanel(){
            $("div.topicInfo").css("display","none");
            $("div.d3Info").css("display","none");
        }

        function selecttopic(){
            var selecttopic=$("#select_id").val();
            var url = 'PaperMapnew?topicID=' + selecttopic;
            window.location.href=url;
        }
        function paperpage(){
            var url='/paper/paperpage?PaperID='+paper+'#';
            window.open(url);
        }
    });
</script>



